import React from "react"; 
import Content from './Components/Content.jsx'
import Header from './Components/Header'
import Total from './Components/Total'
const App = ()=>{
  const course = 'Half Stack application development'
  const parts = [
    {
      name: 'Fundamentals of React',
      exercises: 10
    },
    {
      name: 'Using props to pass data',
      exercises: 7
    },
    {
      name: 'State of a component',
      exercises: 14
    }
  ]

  return(
    <div>
    <Header course = {course}/>
    <Content part1 = {part1.name} part2 = {part2.name} part3 = {part3.name} exercises1 = {part1.exercises} exercises2 = {part2.exercises} exercises3 = {part3.exercises}/>
    <Total course = {course} exercises1 = {part1.exercises} exercises2 = {part2.exercise} exercises3 = {part3.exercises}/>
    </div>
  )
}

export default App;
